table.dataframe {
    border-collapse: collapse;
    border-spacing: 0;
    border: none;
    table-layout: fixed
}

table.dataframe thead {
    border-bottom: 1px solid var(--colab-border-color);
    font-family: var(--colab-code-font-family);
    text-align: right
}

table.dataframe tr,
table.dataframe th,
table.dataframe td {
    border: none;
    padding: 0.5em;
    white-space: normal
}

table.dataframe th {
    font-weight: bold
}

table.dataframe th.col_heading {
    text-align: right
}

table.dataframe tbody tr:nth-child(odd) {
    background: var(--colab-secondary-surface-color)
}

table.dataframe tbody tr:hover,
table.dataframe tbody tr:nth-child(odd):hover {
    background-color: var(--colab-highlighted-surface-color)
}

table.dataframe td {
    text-align: right
}

table.dataTable input.text_filter {
    width: 95%
}

table.dataTable th {
    text-align: left
}

.output_image>img {
    background-color: white;
    max-width: 100%;
    vertical-align: bottom
}

.output_image>img.unconstrained {
    max-width: unset
}




#output-area {
    display: flow-root
}

#output-area button.colab {
    background-color: var(--colab-secondary-surface-color);
    border: 0;
    box-shadow: var(--box-shadow-elevation-3dp);
    color: var(--colab-primary-text-color);
    font-family: var(--colab-chrome-font-family);
    font-size: 11px;
    margin: 0px 4px;
    padding: 6px;
    text-transform: uppercase;
    user-select: none
}

#output-area button.colab:hover {
    background-color: var(--colab-highlighted-surface-color);
    cursor: pointer
}

#output-area .output-error button.error-details {
    background-color: #42a5f5;
    color: white
}

#output-area .output-error button.error-details:hover {
    background-color: #2196f3
}

#output-area .stdin-widget {
    align-items: center;
    display: inline;
    font-family: var(--colab-code-font-family);
    margin-right: 10px;
    margin-top: 10px;
    min-width: 250px;
    padding: 1px
}


.string-repr {
    display: inline
  }

  .string-repr .quote {
    opacity: 75%;
    user-select: none
  }

  .string-repr pre {
    display: inline;
    white-space: pre-wrap;
    word-break: break-all
  }

  .string-repr button {
    color: var(--colab-primary-text-color);
    cursor: pointer;
    border: 1px solid rgb(118, 118, 118);
    border-radius: 2px;
    outline: none
  }

  .string-repr button.copy {
    background: transparent;
    border: none;
    margin-left: 4px;
    opacity: 0;
    padding: 0;
    stroke: var(--colab-primary-text-color);
    transition: opacity 200ms
  }

  .string-repr button.copy svg {
    width: 14px
  }

  .string-repr.hover button.copy,
  .string-repr:hover button.copy {
    opacity: 1
  }

  .string-repr button.more {
    background-color: transparent;
    border-color: transparent;
    display: none;
    padding: 0;
    transition: background-color 200ms, border-color 200ms
  }

  .string-repr.large button.more {
    display: inline
  }

  .string-repr.large.truncated button .collapse {
    display: none
  }

  .string-repr.large button .expand {
    display: none
  }

  .string-repr.large.truncated button .expand {
    display: inline
  }

  .string-repr.hover button.more,
  .string-repr:hover button.more {
    border-color: rgb(118, 118, 118)
  }
